The Football League Show 12.04.2014

Duration: 1 hour 20 min

Manish Bhasin presents the best of the action from Burnley's match against Middlesbrough as the race for the automatic promotion and play-off places intensifies. Also, Harry Redknapp's QPR welcome Nottingham Forest to Loftus Road, and Brighton face Charlton at the Amex.
